I am Ogunlade Olatokunbo



Honesta oratio, Socratica, Platonis etiam. Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Maximas vero virtutes iacere omnis necesse est voluptate dominante. At multis malis affectus. Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. Bonum integritas corporis: misera debilitas.

> Perspicuum est enim, nisi aequitas, fides, iustitia proficiscantur a natura, et si omnia haec ad utilitatem referantur, virum bonum non posse reperiri;
